from collections import deque

def bfs(graph):

    V = len(graph)

    # level=-1
    level=[-1]*(V)
    queue=deque()

    # level(s)=0 and queue s

    level[0]=0
    queue.append(1)

    while len(queue)!=0:
        item=queue.popleft()
        for x in graph[item]:
            if level[x-1]==-1:
                level[x-1]=level[item-1]+1
                queue.append(x)

    return level



